(2, 'profil', '<p>Keberadaan Kantor Pelayanan Terpadu Kabupaten Ketapang merupakan unsur pelaksanaan tugas tertentu Pemerintah Kabupaten Ketapang sesuai dengan Peraturan Daerah Kabupaten Ketapang Nomor 12 tahun 2008 tentang pembentukan kantor Pelayanan Terpadu Kabupaten Ketapang. Tugas Pokok Kantor Pelayanan Terpadu Kabupaten Ketapang adalah membantu Bupati dibidang Pelayanan Perizinan dan Non - Perizinan. Dalam melaksanakan tugas pokok, Kantor Pelayanan Terpadu mempunyai fungsi : Penyusunan perencanaan dibidang pelayanan administrasi perizinan dan non -perizinan terpadu. Perumusan kebijakan teknis dibidang pelayanan administrasi perizinan dan non - perizinan terpadu. Penyelenggaraan urusan pemerintahan dan pelayanan umum dibidang pelayanan administrasi perizinan dan non - perizinan. Pelaksanaan pembinaan koordinasi, pengendalian dan fasilitas pelaksanaan kegiatan dibidang pelayanan administrasi perizinan dan non - perizinan terpadu. Pelaksanaan tugas kedinasan lainya yang diberikan oleh Bupati sesuai dengan tugas dan fungsi.</p>', '2022-08-24 07:45:42', '2022-09-05 09:50:45'),
(3, 'visi', 'Terwujudnya pelayanan prima yang profesional', '2022-08-24 07:45:42', '2022-09-05 09:51:00'),
(4, 'misi', '<ol>\r\n<li>Meningkatkan tertib administrasi;</li>\r\n<li>Mengembangkan sistem pelayanan berbasis informasi teknologi;</li>\r\n<li>Meningkatkan kompetensi dan profesionalisme aparatur pelaksana pelayanan;</li>\r\n<li>Meningkatkan penanganan pengaduan masyarakat, sesuai dengan peraturan perundang-undangan yang berlaku;</li>\r\n<li>Melaksanakan pengolahan data untuk tersedianya arsip dokumen perizinan yang otentik;</li>\r\n<li>Meningkatkan kualitas pelayanan yang ( CERMAT ) cepat, ramah, mudah, adil dan transparan.</li>\r\n</ol>', '2022-08-24 07:45:42', '2022-09-05 09:51:00'),
