INSERT INTO `news` (`id`, `user_id`, `category_id`, `thumbnail`, `title`, `content`, `slug`, `views`, `active`, `created_at`, `updated_at`) VALUES
(23, 1, 5, 'http://dpmptspketapang.000webhostapp.com/asset/img/news/thumbnail/2022-09-06-63170e4a92e4cberita1.jpg', 'Sosialisasi Peraturan Menteri PANRB no 23 Tahun 2017 melalui Video Conference.', '<p>DPMPTSP Kabupaten Ketapang mengikuti Sosialisasi Peraturan Menteri PANRB no 23 Tahun 2017 melalui Video Conference.<br>Semoga kedepan Ketapang mampu melaksanakan konsep Mal Pelayanan Publik, baik dengan bangunan baru atau dengan memanfaatkan bangunan yang sudah ada.</p>\r\n<p>Ketapang Creating Future<br>#ketapanginvestment&nbsp;<br>#dpmptsp<br>#ketapang<br>#ketapangkalbar</p>', 'sosialisasi-peraturan-menteri-panrb-no-23-tahun-2017-melalui-video-conference-06-09-22', 2, '1', '2022-09-06 09:09:30', '2022-09-07 03:10:25'),
(27, 1, 5, 'http://dpmptspketapang.000webhostapp.com/asset/img/news/thumbnail/2022-09-06-631710512f7d1berita2.jpg', 'kegiatan Pemantauan dan Pengawasan Pelaksanaan Penanaman Modal oleh DPMPTSP Kabupaten Ketapang', '<p>Dalam rangka melaksanakan fungsi pemerintah dibidang Penanaman Modal sebagaimana yang di atur dalam Peraturan BKPM Nomor 7 Tahun 2018 tentang Pedoman dan Tata Cara Pengendalian Pelaksanaan Penanaman Modal, memastikan kegiatan usaha melaksanakan kewajiban dan tanggung jawab serta mendapatkan hak sebagaimana yang diatur oleh Undang - Undang Nomor 25 Tahun 2007 Tentang Penanaman Modal, untuk itu DPMPTSP melaksanakan Pemantauan dan Pengawasan Pelaksanaan Penanaman Modal.</p>\r\n<p>Beberapa dokumentasi kegiatan Pemantauan dan Pengawasan Pelaksanaan Penanaman Modal oleh DPMPTSP Kabupaten Ketapang<br>3 s/d 5 November 2020</p>\r\n<p>Ketapang Creating Future<br>Selalu dengan Protokol Kesehatan<br>#ketapanginvestment&nbsp;<br>#dpmptsp<br>#ketapang<br>#ketapangkalbar</p>', '123-06-09-22', 0, '1', '2022-09-06 09:17:02', '2022-09-06 09:18:34'),
(28, 1, 5, 'http://dpmptspketapang.000webhostapp.com/asset/img/news/thumbnail/2022-09-06-631710947c939berita3.jpg', 'Konsolidasi dan Pengarahan Terkait UU CIPTA KERJA oleh Kepala BKPM', '<p>Dalam rangka peningkatan pemahaman aparatur pemerintah khususnya pemerintah daerah, Kepala @bkpm_id (Badan Koordinasi Penanaman Modal) @bahlillahadalia melakukan konsolidasi dan pengarahan kepada seluruh Kepala DPMPTSP prov/kab/kota terkait UU Cipta Kerja.</p>\r\n<p>Selain menyampaikan poin-poin penyederhanaan perizinan berdasarkan UU Cipta Kerja yang baru-baru ini disahkan, Kepala BKPM juga menyampaikan informasi terkait pemberian DAK non fisik kepada seluruh DPMPTSP yang penggunaannya diantaranya untuk pemantauan dan pengawasan pelaksanaan penanaman modal didaerah, sebagaimana arahan Presiden Republik Indonesia Jokowidodo dalam rakor nasional penanaman modal februari 2020 yang lalu.</p>\r\n<p>Pengarahan tersebut dilaksanakan secara vidcom pada Hari Selasa, tanggal 20 Oktober 2020 dan dihadiri seluruh DPMPTSP prov/kab/kota.</p>\r\n<p>#dpmptsp<br>#ketapang<br>#ketapangkalbar<br>#bkpm</p>', 'konsolidasi-dan-pengarahan-terkait-uu-cipta-kerja-oleh-kepala-bkpm-06-09-22', 0, '1', '2022-09-06 09:19:16', '2022-09-06 09:19:21');

