INSERT INTO `service_permissions` (`id`, `service_id`, `name`, `requirement`, `created_at`, `updated_at`) VALUES
(25, 15, 'Pemenuhan Komitmen', '<ol>\r\n<li>Permohonan - TDUP</li>\r\n<li>NIB</li>\r\n<li>Izin Lokasi / Sertifikat (copy)</li>\r\n<li>Izin Lingkungan (copy)</li>\r\n<li>IMB / Perjanjian Sewa / IMB Pemilik Bangunan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;â€‹</li>\r\n<li>KTP (copy)</li>\r\n<li>MAP (Biru Tua)</li>\r\n</ol>', '2022-09-05 05:06:17', '2022-09-05 05:06:17'),
(26, 16, 'Persyaratan Izin TPSLB3', '<ol>\r\n<li>Mengisi Formulir Surat Permohonan Perizinan bermaterai 6000</li>\r\n<li>Persyaratan Administrasi :\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>FC NIB &amp; KTP</li>\r\n<li>Fotokopi Izin Lokasi Kegiatan</li>\r\n<li>FC Izin Kelayakan Lingkungan / Izin Lingkungan</li>\r\n<li>Izin Usaha Kegiatan / IUP</li>\r\n<li>Izin Mendirikan Bangunan (TPS LB3)</li>\r\n<li>FC SIUP (Surat Izin Usaha Perdagangan)</li>\r\n<li>FC Kontrak Kerjasama dengan Pihak ke-3 (pengelola LB3)</li>\r\n<li>FC Legalitas pihak ke-3 (Pengelola LB3)</li>\r\n<li>Uraian Proses Produksi dengan Mengidentifikasi Sumber Penghasil Jenis, Jumlah dan Karakteristik Limbah yang dikelola (Neraca LB3)</li>\r\n<li>SOP Penyimpanan LB3</li>\r\n<li>SOP Tanggap Darurat LB3</li>\r\n<li>Perlengkapan Sistem Tanggap Darurat</li>\r\n</ol>\r\n</li>\r\n<li>Persyaratan Teknis :\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Peta Lokasi Kegiatan (cantumkan koordinat geografis lokasi TPS LB3)&nbsp;</li>\r\n<li>LayOut Area Kegiatan (Cantumkan Lokasi TPS LB3)&nbsp;</li>\r\n<li>LayOut TPS LB3</li>\r\n<li>Desain Konstruksi TPS LB3 Berkala</li>\r\n<li>Tata Letak Saluran Drainase</li>\r\n<li>&nbsp;Photo Penataan Kemasan LB3</li>\r\n<li>&nbsp;Photo Kondisi Fisik TPS LB3</li>\r\n</ol>\r\n</li>\r\n</ol>', '2022-09-05 05:11:21', '2022-09-05 05:11:21'),
(27, 17, 'Persyaratan IUP dan Revisi IUP', '<ol>\r\n<li>Surat Permohonan IUP atau Revisi IUP;</li>\r\n<li>Profil Perusahaan meliputi Akta Pendirian dan Perubahan terakhir yang telah terdaftar di Kementrian Hukum dan Hak Asasi Manusia, komposisi kepemilikan saham, susunan pengurus dan bidang usaha perusahaan;</li>\r\n<li>Nomor Pokok Wajib Pajak;</li>\r\n<li>Rekomendasi kesesuaian dengan Perencanaan Pembangunan Perkebunan kabupaten / kota dari Bupati / walikota untuk IUP yang diterbitkan oleh gubernur;</li>\r\n<li>Rekomendasi kesesuaian dengan Perencanaan Pembangunan Perkebunan Provinsi dari gubernur untuk IUP yang diterbitkan oleh Bupati / Walikota;</li>\r\n<li>Izin Lokasi dari bupati / walikota yang dilengkapi dengan peta digital calon lokasi dengan skala 1:100.000 atau 1:50.000 (cetak peta dan file elektronik) sesuai dengan peraturan perundang-undangan dan tidak terdapat izin yang diberikan pada pihak lain;</li>\r\n<li>Pertimbangan teknis ketersediaan lahan dari dinas yang membidangi kehutanan, apabila areal yang diminta berasal dari kawasan hutan;</li>\r\n<li>Jaminan pasokan bahan baku dengan menggunakan format seperti tercantum dalam Lampiran IV dan Lampiran XII yang merupakan bagian tidak terpisahkan dari Permenta No. 98 Tahun 2013.</li>\r\n<li>Rencana Kerja pembangunan kebun dan unit pengolahan hasil perkebunan termasuk rencana fasilitasi pembangunan kebun untuk masyarakat sekitar;</li>\r\n<li>Izin Lingkungan dari gubernur atau bupati / walikota sesuai kewenangan;</li>\r\n<li>Asli surat pernyataan dukungan dari Kepala Desa, tokoh masyarakat, temenggung yang diketahui oleh Camat setempat;</li>\r\n<li>Asli surat pernyataan dukungan dari Dewan Adat Dayak (DAD) setempat;</li>\r\n<li>Asli surat pernyataan dukungan dari Majlis Adat Budaya Melayu (MABM) setempat;</li>\r\n<li>Pernyataan kesangupan;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Memiliki sumber daya manusia, sarana, prasarana dan sistem untuk melakukan pengendalian organisasi pengganggu tanaman (OPT);</li>\r\n<li>Memiliki sumber daya manusia, sarana, prasarana dan sistem untuk melakukan pembukaan lahan tanpa bakar serta pengendalian kebakaran;</li>\r\n<li>Memfasilitasi pembangunan kebun untuk masyarakat sekitar yang dilengkapi dengan rencana kerja dan rencana pembiayaan;</li>\r\n<li>Melaksanakan kemitraan dengan Pekebun, karyawan dan Masyarakat Sekitar perkebunan;</li>\r\n</ol>\r\n</li>\r\n<li>Keputusan Izin Usaha Perkebunan sebelumnya (khusus untuk revisi IUP)</li>\r\n<li>Map Biola 2 buah (HIJAU).</li>\r\n</ol>', '2022-09-05 05:15:39', '2022-09-05 05:15:39'),
(28, 18, 'SIUP Baru', '<ol>\r\n<li>Mengisi formulir permohonan ( bermaterai 6000 ).</li>\r\n<li>Fotocopy ktp ( pemilik / penanggung jawab perusahaan ).</li>\r\n<li>Pas photo 3 x 4 cm ( 3 lembar ).</li>\r\n<li>Fotocopy surat izin tempat usaha ( SITU ) / izin gangguan ( HO ).</li>\r\n<li>Fotocopy akta&nbsp;pendirian perusahaan ( CV, Firma, Koperasi dan PT).</li>\r\n<li>Fotocopy surat keputusan pengesahan badan hukum (khusus perseroan terbatas (PT), Koperasi dan Yayasan).</li>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li style=\"list-style-type: none;\">&nbsp;</li>\r\n</ul>\r\n</li>\r\n</ol>', '2022-09-05 05:18:12', '2022-09-05 05:18:12'),
(29, 18, 'Permohonan legalisasi / pembukaan kantor cabang / perwakilan perusahaan', '<ol>\r\n<li>Mengisi formulir permohonan.</li>\r\n<li>Fotocopy ktp ( pemilik / penanggung jawab perusahaan ).</li>\r\n<li>Pas photo 3 x 4 cm ( 3 lembar ).</li>\r\n<li>Fotocopy siup kantor pusat perusahaan yang telah dilegalisir &nbsp;oleh pejabat penerbit siup.</li>\r\n<li>Fotocopy dokumen pembukaan kantor cabang / perwakilan perusahaan.</li>\r\n<li>Fotocopy surat izin tempat usaha ( SITU&nbsp;) &nbsp;/ izin gangguan ( HO&nbsp;).</li>\r\n<li>Fotocopy akte pendirian perusahaan ( CV, koperasi dan PT&nbsp;).</li>\r\n</ol>', '2022-09-05 05:18:44', '2022-09-05 05:18:44'),
(30, 18, 'Permohonan perubahan SIUP', '<ol>\r\n<li>Mengisi formulir permohonan.</li>\r\n<li>Fotocopy ktp ( pemilik / penanggung jawab perusahaan ).</li>\r\n<li>Pas photo 3 x 4 cm ( 3 lembar ).</li>\r\n<li>SIUP asli ( siup yang lama ).</li>\r\n<li>Neraca perusahaan ( tahun terakhir khusus perseroan terbatas ( PT&nbsp;).</li>\r\n<li>Data pendukung perusahaan.</li>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li style=\"list-style-type: none;\">&nbsp;</li>\r\n</ul>\r\n</li>\r\n</ol>', '2022-09-05 05:19:13', '2022-09-05 05:19:13'),
(31, 18, 'Permohonan perbaharuan SIUP', '<ol>\r\n<li>Mengisi formulir permohonan ( bermaterai 6000 ).</li>\r\n<li>Fotocopy ktp ( pemilik / penanggung jawab perusahaan ).</li>\r\n<li>Pas photo 3 x 4 cm ( 3 lembar ).</li>\r\n<li>SIUP asli ( siup yang lama ).</li>\r\n<li>Fotocopy akte pendirian perusahaan ( cv, koperasi dan pt ).</li>\r\n</ol>', '2022-09-05 05:19:56', '2022-09-05 05:19:56'),
(32, 18, 'Permohonan penggantian SIUP', '<ol>\r\n<li>SIUP yang hilang\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Mengisi formulir permohonan ( bermaterai 6000 ).</li>\r\n<li>Fotocopy ktp ( pemilik / penanggung jawab perusahaan ).</li>\r\n<li>Pas photo 3 x 4 cm ( 3 lembar ).</li>\r\n<li>Fotocopy SIUP yang lama ( apabila ada ).</li>\r\n<li>Surat keterangan kehilangan dari kepolisian</li>\r\n</ol>\r\n</li>\r\n<li>SIUP yang rusak / SIUP format baru\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Mengisi formulir permohonan ( bermaterai 6000 ).</li>\r\n<li>Fotocopy ktp ( pemilik / penanggung jawab perusahaan ).</li>\r\n<li>Pas photo 3 x 4 cm ( 3 lembar ).</li>\r\n<li>SIUP asli ( siup yang lama ).</li>\r\n</ol>\r\n</li>\r\n</ol>', '2022-09-05 05:20:48', '2022-09-05 05:20:48');

